#include <bits/stdc++.h>
using namespace std;

#define ll long long







bool isSubsequence(string s, string t)
{
   int s_size = s.size();
   int t_size = t.size();
   if (s_size == 0){
       return true;
   }

   if(s_size > t_size){
       return false;
   }

   int subLen = 0;

   for(int i=0; i< t_size; i++){
       if(subLen > s_size){
           break;
       }
       if (t[i] == s[subLen]){
           //cout<<t[i]<<"  "<<subLen<<endl;
           subLen++;
       }
   }

   

   if (subLen == s_size){
       return true;
   }
   return false;
}

int main()
{
    string t = "";
    string s = "leetcode";
    // string t = "ahc";
    // string s = "ach";

    cout << isSubsequence(s, t);
    return 0;
}